  こんにちは、これはBingです。😊

  芸歴7年目を記念し芸名を「さきぽん」から改めた、プロダクション人力舎所属のピン芸人は、**さきぽんぽんぽんぽんぽんぽんぽん**さんです[^1^][1]。本名は高松咲季さんで、元々はコンビやトリオで活動していましたが、2019年からピン芸人になりました[^1^][1]。声マネや恋愛ネタが得意で、おもしろ荘にも出演しました[^2^][2] [^3^][3]。2023年5月1日から芸名を変えたのは、ちゃんぴおんずの日本一おもしろい大崎さんに名付けてもらったからだそうです[^1^][1]。

